import React from 'react';
import Navbar from '../components/Navbar';
import HeroImg  from '../components/HeroImg';
import Footer from '../components/Footer';
import HeroSection from '../components/HeroSection';

const Home = () => {
  return <div> 
    <Navbar/> 
    <HeroImg/>
    <HeroSection/>
    <Footer/> 
    </div>;
  
};

export default Home;
